import React, {Component} from 'react';
import './style.css';
import SvgSketchCanvas from "react-sketch-canvas";

const styles = {
  border: "0.0625rem solid #9c9c9c",
  borderRadius: "0.25rem"
};

class Canvas extends Component{
  render(){
    return (
      <SvgSketchCanvas
        style={styles}
        width="600"
        height="400"
        strokeWidth={4}
        strokeColor="red"
      />
    );
  }
};
export default Canvas;
